INSERT INTO `th_package` (`id`, `packageName`, `slug`, `meta_title`, `meta_keyword`, `meta_description`, `description`, `picup_drop_point`, `transportation`, `days`, `night`, `distance`, `estimated_time`, `exclusions`, `ac`, `route_information`, `taxi_fare`, `image`, `priority`, `status`, `creationDate`, `updationDate`) VALUES
(1, 'Dwarka | Somnath |Sasan', 'dwarka-packages', 'Dwarka Packages', 'Dwarka Packages', 'Dwarka Packages', '<p>Dwarka Somnath Tour from Ahmedabad is ideally made for the spiritually inclined and both destination is cover in 3 night 4 days. You will feel spiritual experiences as you entered into the holy land of Dwarka and Somnath. Dwarka is believed to be the mythical kingdom of Lord Krishna while Somnath is known for the famous Somnath Jyotirlinga temple of Lord Shiva. if you are planning this trip than you should plan to visit Dwarka Somnath from the month of July to March because in this time weather is normal.</p>', '', '', 4, 3, '', '', 'Food & Personal Expense', 'AC', '', '', 'somanth.jpg', 0, 'Active', '2020-08-25 11:12:46', '2020-08-25 14:57:00'),
(2, 'Mount |Abu |Rajasthan', 'best-of-gujrat', 'Mount Abu Rajasthan', 'Best Of Gujrat', 'Best Of Gujrat', '<p>Gujarat tour packages set the mood right in the minds of the travelers bringing them to this place during vacations. If you endeavor of a vacation trip or plan to go for a vacation in heaven, Gujarat is the right place to opt for. The land of affluent history with splendid tradition, heritage, and culture, Gujarat calls to be the seventh largest state in India situated on the western side of our country. A radiant Indian state, Gujarat is considered to be the most captivating destination spots for domestic and international travelers. You can indeed traverse to this incredible place for many eye catchy reasons. The state of Gujarat is considerably blessed with various attractions like the historic architecture, world-class monuments, exotic locations, temples and different wildlife species. Moreover, Amitabh Bachchan is the brand ambassador of Gujarat Tourism.</p>', '', '', 0, 0, '', '', 'Food & Personal Expense', 'AC', '', '', 'mountabu1.jpg', 2, 'Active', '2020-08-25 11:15:45', '2020-08-25 14:58:16'),
(3, 'Statue of Unity |Poicha', 'statue-of-unity', 'Statue of Unity', 'Statue of Unity', 'Statue of Unity', '<p>Want to go Statue of unity from Ahmedabad? It is located in remote area so direct bus and rail options are limited. Along with that it has many places to see around. So hire a cab is best option. We can offer one day tour from Ahmedabad to Statues of unity and return back with 7 places near by with complete guidance. You can book car/bus/tempo travel to reach statue of unity from Ahmedabad Total Distance : 210 Kms Appox 3.5 Hours to 4 Hours from Ahmedabad via National Express Highway 1 (Ahmedabad – Vadodara)</p>', '', '', 0, 0, '', '', 'Food & Personal Expense', 'AC', '', '', 'satutu-unit1.jpg', 4, 'Active', '2020-08-25 11:18:49', '2020-08-25 15:00:01'),
(4, 'Rann of Kutch', 'nashik-shirdi-trimbakeshwar', 'Rann Of Kutch', 'Rann of Kutch', 'NASHIK, SHIRDI & TRIMBAKESHWAR', '<p>The Great Rann of Kutch is a salt marsh in the Thar Desert in the Kutch District of Gujarat, India. It is about 7500 km?2; in the area and is reputed to be one of the largest salt deserts in the world. This area has been inhabited by the Kutchi people</p>', '', '', 3, 4, '', '', 'Food & Personal Expense', 'AC', '', '', 'runn1.jpg', 5, 'Active', '2020-08-25 11:31:11', '2020-08-25 15:01:28'),
(5, 'Diu and Daman', 'diu-and-daman', 'Diu and Daman', 'Diu and Daman', 'Diu and Daman', '<p>Daman and Diu, a union territory in west India, consists of 2 separate areas divided by the Arabian Sea. The Daman Ganga River flows through the coastal town of Daman. Diu is a small island and mainland village.</p>', '', '', 3, 4, '', '', 'Food & Personal Expense', 'AC', '', '', 'diyuanddaman.jpeg', 3, 'Active', '2020-08-25 12:36:03', '2020-08-25 14:59:29');
